                                    <div className="col-lg-12">
                                        <Card style={{width: 180}}>
                                            <ImgCrop rotate>
                                                <Upload
                                                    className="avatar-uploader flex flex-wrap justify-center"
                                                    action="https://www.mocky.io/v2/5cc8019d300000980a055e76"
                                                    listType="picture-card"
                                                    fileList={fileList}
                                                    onChange={onChange}
                                                    onPreview={onPreview}
                                                >
                                                    {fileList.length < 1 && <PlusOutlined />}
                                                </Upload>
                                            </ImgCrop>
                                        </Card>
                                    </div>
                                </div>
                            </div>

                            <Adminfooter/>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
            ;
    }
}

export default ProfilSekolah;
